import React, { Component } from "react";

import {
    Navbar,
    NavItem,
    Icon,
    SideNav,
    SideNavItem,
    Button
} from "react-materialize";
import SideMenu from "./SideMenu";

import M from "materialize-css";

class Nav extends Component {
    componentDidMount() {}
    render() {
        return (
            <div>
                <Navbar
                    className="light-blue lighten-1"
                    alignLinks='right'
                    brand={

                        <a className='brand-logo' style={{paddingLeft: "20px"}}  href='#'>
                            Book Me In
                        </a>
                    }
                    menuIcon={<Icon >menu</Icon>}
                    options={{
                        draggable: true,
                        edge: "left",
                        inDuration: 250,
                        onCloseEnd: null,
                        onCloseStart: null,
                        onOpenEnd: null,
                        onOpenStart: null,
                        outDuration: 200,
                        preventScrolling: true
                    }}
                >
{/*   
                    <NavItem href=''>Getting started</NavItem>
                    <NavItem href='components.html'>Components</NavItem> */}
                    <SideMenu />
                </Navbar>

            </div>
        );
    }
}

export default Nav;
